// src/pages/SmileGallery/smileGallery.styles.js

const styles = {
  section: {
    py: 6,
    backgroundColor: '#fff',
  },
  heading: {
    mb: 4,
    fontWeight: 600,
    color: '#0db1ad',
    textAlign: 'center',
  },
  loading: {
    display: 'flex',
    justifyContent: 'center',
    mt: 6,
  },
  errorBox: {
    maxWidth: 600,
    mx: 'auto',
    mb: 4,
  },
};

export default styles;
